import Link from "next/link";

const Navbar = () => {
  const styles = {
    display: "flex",
    justifyContent: "space-between",
  };
  console.log("Navbar Page");
  return (
    <div style={styles}>
      <div>
        <Link href="/about">About</Link>
      </div>

      <div>
        <Link href="/about-us">About US</Link>
      </div>
    </div>
  );
};

export default Navbar;
